INSERT INTO `matrixcontent_blogdetailmatrix` VALUES (1,219,1,'2021-12-14 12:51:36','2021-12-14 12:51:36','31daa341-dcc4-485c-9427-deec2cb05778',NULL,NULL),(3,221,1,'2021-12-14 12:52:12','2022-01-11 11:00:58','1d9bd7f1-9bc3-4ce2-92e7-89e10b2c4ae5',NULL,'Freies Bild'),(4,223,1,'2021-12-14 12:52:12','2021-12-14 12:52:12','a4c2a23e-3714-42ff-83b8-e216944f935e',NULL,NULL),(7,227,1,'2021-12-14 13:05:48','2022-01-11 11:00:58','1d8defbd-4630-4180-b11e-78ce0111b2b4','<p>Euer Logo ist das Gesicht eures Unternehmens. Jeder, mit dem ihr geschftlich zu tun habt, kommt in Berhrung damit. Damit ihr nicht in die Tonne greift, haben wir euch Logo Eigenschaften zusammengestellt, die euer Logo auf jeden Fall mitbringen sollte.</p>\n<p dir=\"ltr\">Ein Logo ist erst einmal ein grafisches Zeichen, das ein bestimmtes Subjekt reprsentiert<a href=\"https://de.wikipedia.org/wiki/Logo_(Zeichen)\">*</a>. Dass damit ein Unternehmen, ein Produkt oder eine Person gemeint sein kann, versteht sich.</p>\n<p dir=\"ltr\">Nahezu jedes Unternehmen hat ein Logo. Und sicher auch euer Unternehmen. Ob ihr also alle Grundvoraussetzung mit eurem bestehenden Logo erfllt oder, ob ihr euch dringend um ein neues, professionelles Logo bemhen solltet, knnt ihr jetzt in Erfahrung bringen.</p>\n<h2 dir=\"ltr\"><strong>One in a million - Einmaligkeit des Logos</strong></h2>\n<p dir=\"ltr\">Ok, zugegeben: One in a million ist nicht wirklich das, worauf wir hinaus wollen. Eigentlich geht es uns vielmehr darum, dass <strong>euer Logo zu eurem Business passen sollte</strong> - im besten Fall eure Werte unterstreicht.</p>\n<p dir=\"ltr\">Ein Anwalt, der Seriositt, Zuverlssigkeit und Professionalitt vermitteln will, sollte also keine zu verspielte Schriftart nutzen.</p>',NULL),(8,229,1,'2021-12-14 13:05:48','2021-12-14 13:05:48','2c5b3231-22c7-4b9c-b8aa-b684cd612985',NULL,NULL),(9,230,1,'2021-12-14 13:05:48','2021-12-14 13:05:48','57280a9a-45e3-44ea-a055-202e7914de95',NULL,NULL),(12,236,1,'2021-12-14 13:19:45','2021-12-14 1