 oder euren Ttigkeitsbereich erahnen, jedoch solltet ihr nicht darauf abzielen, eure Lebensgeschichte in einem Logo zu erzhlen. Viel eher solltet ihr dafr sorgen, dass die Betrachter nicht auf falsche Ideen kommen:</p>\n<ul><li dir=\"ltr\"><p dir=\"ltr\">Ein Anwalt soll nicht fr einen Kindergarten gehalten werden,</p></li><li dir=\"ltr\"><p dir=\"ltr\">ein Tech-Startup will nicht traditionell und angestaubt wirken und</p></li><li dir=\"ltr\"><p dir=\"ltr\">airbnb will nicht wie ein Hostel rberkommen.</p></li></ul><p>Natrlich sollte euer Logo in diesem Kontext auch einfach ein <strong>Unterscheidungsmerkmal</strong> sein und euch von anderen Unternehmen abgrenzen.</p>\n<p><br /></p>',NULL),(18,243,1,'2021-12-14 13:20:38','2021-12-14 13:20:38','ce32c41f-ce8e-4368-93b2-f16261d791b4','<p dir=\"ltr\">Es ist schwer, die genaue Grenze zu ziehen, was hier noch als innovativ und experimentell durchgeht und was einfach unpassend ist, im Zweifel wrden wir allerdings empfehlen, vielleicht doch ein anderes Konzept in Erwgung zu ziehen.</p>\n<p dir=\"ltr\">In einigen Fllen vermittelt euer Logo auch direkt noch etwas mehr und lsst eure Branche oder euren Ttigkeitsbereich erahnen, jedoch solltet ihr nicht darauf abzielen, eure Lebensgeschichte in einem Logo zu erzhlen. Viel eher solltet ihr dafr sorgen, dass die Betrachter nicht auf falsche Ideen kommen:</p>\n<ul><li dir=\"ltr\"><p dir=\"ltr\">Ein Anwalt soll nicht fr einen Kindergarten gehalten werden,</p></li><li dir=\"ltr\"><p dir=\"ltr\">ein Tech-Startup will nicht traditionell und angestaubt wirken und</p></li><li dir=\"ltr\"><p dir=\"ltr\">airbnb will nicht wie ein Hostel rberkommen.</p></li></ul><p>Natrlich sollte euer Logo in diesem Kontext auch einfach ein <strong>Unterscheidungsmerkmal</strong> sein und euch von anderen Unternehmen abgrenzen.<br /></p>\n',NULL),(19,244,1,'2021-12-14 13:20:47','2021-12-14 13:20:47','bde2b195-8e34-468f-915b-9b1a00bf3430','<p dir=\"ltr\">Es ist schwer, die genaue Grenze zu ziehen, was hier n